import Header from './components/Header';
import Entry from './components/Entry';
import Entries from '/Users/alokwaigaonkar/travel_journal/src/data.js';

function App() {
  const entry=Entries.map((entry)=>{
    return <Entry 
    img={entry.img}/>
  })
  return (
    <>
    <Header />
    <Entry />
    </>
  );
}

export default App;
